import React from 'react';
import { Link } from 'react-router-dom';

const Blog = ({blogInfo: {name, category,}}) => {
  return (
    <div className='blog'>
      <div className='blog-thumb'>
        <a href="#!">
          <span>
            {category}
          </span>
        </a>
      </div>
    </div>
  );
}

export default Blog;
